import React, {Component} from 'react';
import './App.css';

class App extends Component {
  render() {
    return (
      <div className="App">
        Hello, world
        <FirstComponent />
        <SecondComponent />
      </div>
    );
  }
}

class FirstComponent extends Component {
  render() {
    return (
      <div className="FirstComponent">
        FirstComponent
      </div>
    );
  }
}

class SecondComponent extends Component {
  render() {
    return (
      <div className="SecondComponent">
        SecondComponent
      </div>
    );
  }
}

export default App;
